import axios from "axios";
import { useState, useEffect} from "react";
import infiniteScroll from 'infinite-scroll';
import './App.css';

export default function App() {
    const [results, setResults] = useState([])
    useEffect(() => {
      axios
        .get('./Foodsource.json?page=2&limit=50')
        .then(res => { 
          setResults(res.data)
        })
        .catch(e => { console.log(e)}) },[]);
        const displayData = results.map(
          (info)=> {
            return(
              <tr>
                <td>{info.resteraunt}</td>
                <td>{info.name}</td>
                <td>{info.people}</td>
                <td>{info.timetag}</td>
              </tr>
            )
          }
        )

        const allrows = document.querySelectorAll(".card")




  return (
    <div className="App">
      <div>
      <table class="table table-striped">
        <thead>
          <tr align="center">
            <th>Resteraunts</th>
            <th align="center">Food Item</th>
            <th>Number of times bought &nbsp;</th>
            <th>How recently bought</th>
          </tr>
        </thead>
        <tbody class="card show">
          {displayData.slice(0,100)}
        </tbody>
        <tbody class="card">
          {displayData.slice(100,200)}
        </tbody>
        <tbody class="card">
          {displayData.slice(200,300)}
        </tbody>
        <tbody class="card">
          {displayData.slice(300,400)}
        </tbody>
        <tbody class="card">
          {displayData.slice(400,500)}
        </tbody>
        <tbody class="card">
          {displayData.slice(500,600)}
        </tbody>
        <tbody class="card">
          {displayData.slice(600,700)}
        </tbody>
        <tbody class="card">
          {displayData.slice(800,900)}
        </tbody>
        <tbody class="card">
          {displayData.slice(900,1000)}
        </tbody>
        <tbody class="card">
          {displayData.slice(1000,1100)}
        </tbody>
      </table>
    </div>
    </div>


  );
}
